const layoutStyle = {
  margin: 20,
  padding: 20
};

const Layout = props => (
  <div style={layoutStyle}>
    <img className="guc" src="/dumpTRUCKlogo.svg" />
    {props.children}
    <Files />
    <style jsx>{`
      .guc {
        height: 93%;
        width: 93%;
      }
    `}</style>
  </div>
);

export default Layout;
